import React from 'react';
import { StyleSheet, Text, View } from 'react-native';
import { Table, TableWrapper, Row, Rows, Col } from 'react-native-table-component';

export default function ResultTableBase({
  bgColor, 
  color, 
  renderCell
}) {
    const tableData = [
      [0, 0],
      [0, 0]
    ]
    return (
      <View style={{
        ...styles.container,
        backgroundColor: bgColor
      }}>
        <View style={styles.header}>
          <Text style={{
            ...styles.headerTitle,
            color
          }}>Date</Text>
        </View>

        <Table borderStyle={{borderWidth: 1}}>
          <TableWrapper borderStyle={styles.tableBorder}>
            <Col data={['Вес', 'Повторы']} style={styles.tableRowTitle} heightArr={[40, 40]} textStyle={styles.tableRowTitleText}/>
            <Rows data={tableData} flexArr={[1, 1]} style={styles.tableRow} textStyle={null} />
          </TableWrapper>
        </Table>
      </View>
    )
  }
  

const styles = StyleSheet.create({
    container: {
      backgroundColor: '#fff',
      paddingLeft: 1,
      paddingRight: 1
    },
    header: {
      paddingBottom: 10,
      paddingTop: 10,
    },
    headerTitle: {
      fontSize: 20,
      textAlign: 'center',
    },
    tableBorder: {
      borderWidth: 1,
      borderColor: 'black'
    },
    tableRow: {
      flexDirection: 'row',
      height: 40,
      borderTopWidth: 1,
      borderLeftWidth: 1,
      borderRightWidth: 1,
    },
    tableRowTitle: {
      flexBasis: 98,
      paddingLeft: 10,
      paddingRight: 10,
      borderRightWidth: 1,
    },
    tableRowTitleText: {
      fontSize: 18,
      lineHeight: 40,
    }
  });
